import React from "react";
import { Link } from "react-router-dom";
import ScoreList from "./scoreList";

const home = (props) => {
    return (
        <div className="home">
            <h1>내 일주일은?</h1>
            <div className='row'>
                <ScoreList list={this.state.list[2]}/>
                <Link to="/edit">편집하기</Link>
            </div>
        </div>
    )
}

export default home;
